import React from 'react'

class App extends React.Component{
  constructor(props){
    super(props);
    this.state = {
      mode: 'edit'
    }
    this.handleClick = this.handleClick.bind(this)
  }
  handleClick(event){
    console.log(this.state.mode)
  }
}

export default App;
